/// Helper to compare tensors and provide detailed panic messages.
fn assert_tensors_are_close<D: ndarray::Dimension>(
    actual: &Array<f32, D>,
    expected: &Array<f32, D>,
    label: &str,
    tolerance: f32,
) {
    assert_eq!(actual.shape(), expected.shape(), "Tensor shapes for '{}' do not match. Actual: {:?}, Expected: {:?}", label, actual.shape(), expected.shape());
    
    let mut max_diff = 0.0;
    let mut max_diff_idx = 0;

    for (i, (a, b)) in actual.iter().zip(expected.iter()).enumerate() {
        let diff = (a - b).abs();
        if diff > max_diff {
            max_diff = diff;
            max_diff_idx = i;
        }
    }

    if max_diff > tolerance {
        let actual_val = actual.iter().nth(max_diff_idx).unwrap();
        let expected_val = expected.iter().nth(max_diff_idx).unwrap();
        panic!(
            "Tensor '{}' is not close enough. \
            \n- Tolerance:         {} \
            \n- Max Difference:    {} \
            \n- Index of Max Diff: {} \
            \n- Actual Value:      {} \
            \n- Expected Value:    {}",
            label, tolerance, max_diff, max_diff_idx, actual_val, expected_val
        );
    }
    println!("âœ“ Parity test passed for '{}'", label);
}

/// A struct to hold all the components of a Llama layer for testing.
struct TestLlamaLayer {
    decoder_layer: DecoderLayer,
    // Store components to test them individually
    q_proj: (Array2<f32>, Array1<f32>),
    k_proj: (Array2<f32>, Array1<f32>),
    v_proj: (Array2<f32>, Array1<f32>),
    o_proj: (Array2<f32>, Array1<f32>),
    gate_proj: Array2<f32>,
    up_proj: Array2<f32>,
    down_proj: Array2<f32>,
    input_norm: RMSNorm,
    post_attn_norm: RMSNorm,
}

